import React, { useState, Component } from 'react'
import SearchBar from './components/SearchBar'
import Popup from './components/Popup'


class App extends Component {

componentDidMount() {
  fetch('/api/movies')
  .then(res=> res.json())
  .then(movies => console.log(movies))

}





  render() {
    return (

      <div className="App">
        <h1> Movie Search </h1>

        <div>
         <SearchBar/>

        </div>

      </div>

    )

  }
}

export default App;
